/// <reference path="libs/easeljs/easeljs.d.ts" />
/// <reference path="libs/preloadjs/preloadjs.d.ts" />
/// <reference path="main.ts" />

module game {

  /**
   * Preload Class.
   *
   * @class
   * @name Preload
   */
  export class Preload {

    static SOUND_NAME: string[] = ['alert', 'loop', 'shot', 'shot2', 'boss' , 'explode', 'clear'];

    private _assets: Object = {};
    private _soundLoadCnt: number = 0;

    /**
     * コンストラクタ.
     *
     * @constructor
     */
    constructor() {

    }

    // ==========================================
    //   Public
    // ==========================================

    /**
     * プリロードを行う.
     */
    public load() {

      var loader: createjs.LoadQueue = new createjs.LoadQueue(false),
          manifest: Object[] = [

            {'id': 'bg', type: "image", 'src': 'data:image/png;base64,'},
            {'id': 'boss', type: "image", 'src':'data:image/png;base64,'},
            {'id': 'enemy', type: "image", 'src': 'data:image/png;base64,'},
            {'id': 'enemy2', type: "image", 'src': 'data:image/png;base64,'},
            {'id': 'enemy3', type: "image", 'src': 'data:image/png;base64,'},
            {'id': 'player', type: "image", 'src': 'data:image/png;base64,'},
            {'id': 'bossBullet', type: "image", 'src': 'data:image/png;base64,'},
            {'id': 'enemyBullet', type: "image", 'src': 'data:image/png;base64,'},
            {'id': 'enemyBullet2', type: "image", 'src': 'data:image/png;base64,'},
            {'id': 'playerBullet', type: "image", 'src': 'data:image/png;base64,'},
            {'id': 'enemyExplode', type: "image", 'src': 'data:image/png;base64,'},
            {'id': 'playerExplode', type: "image", 'src': 'data:image/png;base64,'},

            {'id': 'avaFace', type: "image", 'src': 'data:image/gif;base64,'},
            {'id': 'avaArm', type: "image", 'src': 'data:image/gif;base64,'},
            {'id': 'avaCloth', type: "image", 'src': 'data:image/gif;base64,'},
            {'id': 'avaHair', type: "image", 'src': 'data:image/gif;base64,'},
            {'id': 'avaHair2', type: "image", 'src': 'data:image/gif;base64,'},
            {'id': 'avaArmDefault', type: "image", 'src': 'data:image/gif;base64,'},
            {'id': 'avaClothDefault', type: "image", 'src': 'data:image/gif;base64,'}
          ];

      loader.addEventListener("fileload", this._fileLoadHandler);
      loader.addEventListener("complete", this._completeHandler);
      loader.loadManifest(manifest);
    }

    // ==========================================
    //   Event Handler
    // ==========================================

    /**
     * fileLoadHandler.
     *
     * @param {createjs.Event} e イベントオブジェクト
     */
    private _fileLoadHandler = (e: createjs.Event) => {

      this._assets[e.item.id] = e.result;
    };

    /**
     * completeHandler.
     */
    private _completeHandler = (): void=> {

      createjs.Sound.registerPlugins([createjs.WebAudioPlugin, createjs.HTMLAudioPlugin, createjs.FlashPlugin]);
      createjs.Sound.alternateExtensions = ["mp3"];
      createjs.Sound.addEventListener("fileload", this._soundLoadHandler);

      for(var i = Preload.SOUND_NAME.length; i--;) {

        createjs.Sound.registerSound('sound/'  + Preload.SOUND_NAME[i] + '.mp3', Preload.SOUND_NAME[i]);
      }
    };

    /**
     * soundLoadHandler.
     */
    private _soundLoadHandler = (): void=> {

      this._soundLoadCnt++;

      if(this._soundLoadCnt !== Preload.SOUND_NAME.length) {

        return;
      }

      var main: Main = new Main(this._assets),
          element: HTMLElement = <HTMLElement>document.querySelector('body');

      main.init();
      element.style.backgroundImage = 'none';
    };
  }
}